{

    internal InnerDeploymentIoTJobExecutionsRolloutConfigFactory JobExecutionsRolloutConfigFactory { get; set; }

    internal InnerDeploymentIoTJobTimeoutConfigFactory TimeoutConfigFactory { get; set; }

    internal InnerDeploymentIoTJobAbortConfigFactory AbortConfigFactory { get; set; }

    protected override Humidifier.GreengrassV2.DeploymentTypes.DeploymentIoTJobConfiguration Create()
    {
        var deploymentIoTJobConfigurationResult = CreateDeploymentIoTJobConfiguration();
        factoryAction?.Invoke(deploymentIoTJobConfigurationResult);

        return deploymentIoTJobConfigurationResult;
    }

    private Humidifier.GreengrassV2.DeploymentTypes.DeploymentIoTJobConfiguration CreateDeploymentIoTJobConfiguration()
    {
        var deploymentIoTJobConfigurationResult = new Humidifier.GreengrassV2.DeploymentTypes.DeploymentIoTJobConfiguration();

        return deploymentIoTJobConfigurationResult;
    }
    public override void CreateChildren(Humidifier.GreengrassV2.DeploymentTypes.DeploymentIoTJobConfiguration result)
    {
        base.CreateChildren(result);

        result.JobExecutionsRolloutConfig ??= JobExecutionsRolloutConfigFactory?.Build();
        result.TimeoutConfig ??= TimeoutConfigFactory?.Build();
        result.AbortConfig ??= AbortConfigFactory?.Build();
    }

} // End Of Class

